import React, { Component } from 'react'

export default class Posapi extends Component {

    state = {

       name:'' 

    }

    handleChange = event => {
        this.setState({ name: event.target.value });

      }

    render() {
        return (
            <div>
                <form>
                    <label>
                        Person Name:
                        <input type="text" name="name"  onChange= {this.handleChange}/>
                    </label>
                    <button type="submit"></button>
                </form>
            </div>
        )
    }
}
